	 = " Options\n*********\n\n# Options syntax in the manual\n\n Syntax\n========\n\nline\t\t::= Number\npar\t\t::= \"[\" | \"]\"\noptionBody\t::= par line \"..\" par | par line \"..\" line par | line\ncommaOptBody\t::= optionBody \",\" commaOptBody | optionBody\noption\t\t//= commaOptBody | \"indent\" \n"
_Manual_build_sh
	 = "\n# Supposed to be run from within haskell. All .md's will be dropped into /bin\necho \"Running the manual building script\"\n\nmkdir .bin 2> /dev/null\ncd src/Assets/Manual 2> /dev/null\n\n# Done by autoPreprocess in haskell:\n# cp *.md   .bin/\ncp *.tex  .bin/\ncp *.svg  .bin/\ncp *.png  .bin/\ncp *.html .bin/ 2> /dev/null\ncp *.generate  .bin/\ncp *.slideshow .bin/\ncd .bin\nfor FILE in *.svg\ndo\n\tOUTFILE=${FILE%.svg}\n\tif [ -e $OUTFILE.png ]\n\tthen\n\t\t# echo \"INKSCAPE: Skipping generation of $OUTFILE.png\"\n\t\techo \"\" >/dev/null\n\telse\n\t\tinkscape -D -d=360 -z --file=$FILE --export-png=$OUTFILE.png | sed \"s/^/INKSCAPE: /g\"\n\tfi\ndone\n\nPANDOC_EXTENSIONS=\" --tab-stop=8 -f markdown+link_attributes+grid_tables+pandoc_title_block+pipe_tables+implicit_header_references --latex-engine=xelatex\"\nfor SET in *.slideshow\ndo\n\tSETNAME=${SET%.slideshow}\n\tOUTFILE=\"$SETNAME-slides.md\"\n\techo -n \"Building slideshow $SET (dumpfile $OUTFILE) with lines: \"\n\trm $OUTFILE 2> /dev/null\n\tfor FILE in `cat $SET`\n\tdo\n\t\tcat $FILE | sed \"s/\\[style=terminal\\]//g\" >> $OUTFILE\n\tdone\n\tcat $OUTFILE | wc -l\n\t\n\techo \"Running pandoc for slides on $OUTFILE\"\n\tcat $OUTFILE\n\trm \"Slides_$SETNAME.pdf\" 2> /dev/null\n\tpandoc $PANDOC_EXTENSIONS --slide-level 2 --listings -t beamer $OUTFILE -o \"Slides_$SETNAME.pdf\" # --variable mainfont=\"Ubuntu\"\n\tcp \"Slides_$SETNAME.pdf\" ../Output/\n\ndone\n\nfor SET in *.generate\ndo\n\tSETNAME=${SET%.generate}\n\tOUTFILE=\"$SETNAME-all.md\"\n\techo -n \"$OUTFILE \"\n\trm $OUTFILE 2> /dev/null\n\tfor FILE in `cat $SET`\n\tdo\n\t\tcat $FILE >> $OUTFILE\n\tdone\n\tcat $OUTFILE | wc -l\n\t\n\t# HTML OPTIONS\n\tpandoc $PANDOC_EXTENSIONS --self-contained $OUTFILE -o \"ALGT_$SETNAME.html\" | sed \"s/^/PANDOC-HTML  /g\"\n\tcp \"ALGT_$SETNAME.html\" ../Output/\n\n\n\n\t# LaTeX\n\tpandoc $PANDOC_EXTENSIONS --listings --chapters $OUTFILE -o $SETNAME.tex | sed \"s/^/PANDOC-TEX /g\"\n\n\n\tif [ $SETNAME = \"Focus\" ]\n\tthen\n\t\tcat Main.tex | sed \"/%NOFOCUS/d \" | sed \"s/\167/$SETNAME/\" > \"ALGT_$SETNAME.tex\"\n\telse\n\t\tcat Main.tex | sed \"s/\167/$SETNAME/\" > \"ALGT_$SETNAME.tex\"\n\tfi\n\t\n\techo \"Running pdf latex...\"\n\trm \"ALGT_$SETNAME.pdf\"\n\tLATEX_OUTPUT=`lualatex -halt-on-error \"ALGT_$SETNAME.tex\" | sed \"s/^/\167LATEX-$SETNAME: /g\"`\n\tcp \"ALGT_$SETNAME.pdf\" ../Output/\n\tif [ $? -eq 0 ]\n\tthen\n\t\techo \"Pdf-compilation successfull\"\n\telse\n\t\techo \"NO PDF FOUND\"\n\t\techo $LATEX_OUTPUT | sed \"s/\167/\\\\n/g\"\n\tfi\ndone\n\n\necho \"MANUAL IS BUILT\"\n\n\n"
_Manual_1Overview_md
	 = " What is ALGT?\n===============\n\n_ALGT_ (_Automated Language Generation Tool_ [^AGT-Name]) is a tool to formally specify any programming language. This is done by first declaring a syntax, using BNF, and then declaring semantics by introducing logical deduction rules, such as evaluation or typing rules.  Eventually, properties can be introduced which can be tested. Of course, these can be run.\n\nThe tool is kept as general as possible, so any language can be modelled.\n\n\n[^AGT-Name]: Note the similarity of _ALGT_ and _AGT_ . The tool started its life as _AGT_, based on the paper [_Abstracting Gradual Typing_](https://pleiad.cl/papers/2016/garciaAl-popl2016.pdf). When it became more general, another name and acronym was chosen.\n"
