_Manual_Files_STFLForSlides_language
	 = " \n STFL \n******\n\n# A Simply Typed Functional Language\n\n Syntax\n========\n\nbasetype::= \"Bool\" | \"Int\" | \"(\" type \")\"\ntype\t::= basetype \"->\" type | basetype\n\nbool\t::= \"True\" | \"False\"\nint\t::= Number\nvar\t::= Identifier\n\nexpr\t::= term \"+\" expr\n\t| term expr\n\t| term\n\n\nterm\t::= \"If\" expr \"Then\" expr \"Else\" expr\n\t| \"(\" \"\\\\\" var \":\" type \".\" expr \")\"\n\t| bool\n\t| int\n\t| var\ntyping\t\t\t::= var \":\" type\ntypingEnv\t::= typing \",\" typingEnv | \"{}\"\n\n Functions\n===========\n\n\ndomain \t\t\t\t: type -> type\ndomain(\"(\" T \")\")\t\t= domain(T)\ndomain((\"(\" T1 \")\") \"->\" T2)\t= T1\ndomain(T1 \"->\" T2)\t\t= T1\n\ncodomain \t\t\t: type -> type\ncodomain(\"(\" T \")\")\t\t= codomain(T)\ncodomain(T1\"->\" (\"(\" T2 \")\")) \t= T2\ncodomain(T1 \"->\" T2)\t\t= T2\n\n\n Relations\n===========\n\n# (:) is reserved, as predicate that a term is of a production rule\n# one can refer to rewrite rules/functions earlier on\n\n(\8594)\t: expr (in), expr (out)\n(\8594*)\t: expr (in), expr (out)\n(\10003)\t: expr (in)\n\n(\8866)\t: typingEnv (in), expr (in), type (out)\n\n(::)\t: expr (in), type (out)\n\n(==)\t: type (in), type (in)\n\n\n Rules\n=======\n\n\n------------------------------------- [EvalIfTrue]\n \"If\" \"True\" \"Then\" e1 \"Else\" e2 \8594 e1\n\n\n------------------------------------- [EvalIfFalse]\n \"If\" \"False\" \"Then\" e1 \"Else\" e2 \8594 e2\n\n\n n1:int\t\tn2:int\n------------------------------------\t[EvalPlus]\n n1 \"+\" n2 \8594 !plus:int(n1, n2)\n\n\n------------------------------------- [EvalLamApp]\n (\"(\" \"\\\\\" var \":\" type \".\" e \")\") arg \n\t\8594 !subs:e(var, arg, e)\n\n\n expr0 \8594 expr1\n----------------------------\t\t[EvalCtx]\n expr[expr0] \8594 expr[expr1]\n\n\n\n b:bool\n-------\t\t\t[CanonBool]\n (\10003) b\n\n n:int\n---------\t\t[CanonNumber]\n (\10003) n\n\n\n\n (\10003) e\n--------\t\t\t[BigStepCanon]\n e \8594* e\n\n e0 \8594 e1\te1 \8594* e2\n-------------------------\t[BigStepRec]\n e0 \8594* e2\n\n e0 \8594 e1\t(\10003) e1\n------------------------\t[BigStepBase]\n e0 \8594* e1\n\n\n\n\n\n \"{}\" \8866 e, T  \n-----------\t[TEmptyCtx]\n e :: T\n\n\n\n\n n:int\n---------------\t\t[Tnumber] \n \915 \8866 n, \"Int\"\n\n\n b:bool\n----------------\t[Tbool]\n \915 \8866 b, \"Bool\"\n\n\n\n\n\n\n--------------------\t[Tx]\n \915[ x \":\" T ] \8866 x, T\n\n\n \915 \8866 n1, \"Int\"\t\915 \8866 n2, \"Int\"\n------------------------------\t\t\t\t[TPlus]\n \915 \8866 n1 \"+\" n2, \"Int\"\n\n\n \915 \8866 c, \"Bool\"\t\915 \8866 e1, Tl\t\915 \8866 e2, Tr\tTl == Tr\n--------------------------------------------------------\t[TIf]\n \915 \8866 \"If\" c \"Then\" e1 \"Else\" e2, Tl\n\n\n\n ((x \":\" T1) \",\" \915) \8866 e, T2\n-------------------------------------------------------\t[TLambda]\n \915 \8866 \"(\" \"\\\\\" x \":\" T1 \".\" e \")\", ( \"(\" T1 \")\") \"->\" T2\n\n\n\n \915 \8866 e1, TArg -> TREs\t\t\915 \8866 e2, Targ\t\n Targ == domain(Tfunc)\n--------------------------------------- [Tapp]\n \915 \8866 e1 e2, codomain(Tfunc)\n\n\n\n\n\n\n T1 = T2 : type\n--------------- [EqBase]\n T1 == T2\n\n\n T1 == T2\n----------------- [EqParL]\n \"(\" T1 \")\" == T2\n\n T1 == T2\n----------------- [EqParR]\n T1 == \"(\" T2 \")\"\n\n\n Ta1 == Ta2\tTb1 == Tb2\n---------------------------------- [EqArrow]\n Ta1 \"->\" Tb1   ==   Ta2 \"->\" Tb2\n\n\n Properties\n============\n\n e0 :: T\t e0 \8594 e1\n-------------------------- [Preservation]\n         e1 :: T\n\n\n         e0 :: T\n-------------------------- [Progress]\n (\10003) e0    |     e0 \8594 e1 \n\n\n\n# STFL can't contain loops (or recursion), so will always terminate\n\n \n e :: T\n-------- [Termination]\n e \8594* v \n\n"
