	 = "<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n  <meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\n  <meta http-equiv=\"Content-Style-Type\" content=\"text/css\" />\n  <meta name=\"generator\" content=\"pandoc\" />\n  <title></title>\n  <style type=\"text/css\">code{white-space: pre;}</style>\n</head>\n<body>\n<h1 id=\"overview\">Overview</h1>\n<p>This document gives an overview of the <em>ALGT</em>-tool. First, a general overview of what the tool does is given and why it was developped. Second, a hands-on tutorial develops a Simply Typed Functional Language (STFL). Thirdly, the reference manual gives an in-depth overview of the possibilities and command line flags. Fourth, some concepts and algorithms are explained more thoroughly, together with properties they use. And at last, the 'dynamize' and 'gradualize' options are explained in depth, as these are what the master dissertation is about.</p>\n<p>This documentation is about version <strong>0.1.18.1</strong> (<code>Total Color completion, somewhat better</code>), generated on 2017-3-1 .</p>\n<h1 id=\"what-is-algt\">What is ALGT?</h1>\n<p><em>ALGT</em> (<em>Automated Language Generation Tool</em> <a href=\"#fn1\" class=\"footnoteRef\" id=\"fnref1\"><sup>1</sup></a>) is a tool to formally specify any programming language. This is done by first declaring a syntax, using BNF, and then declaring semantics by introducing logical deduction rules, such as evaluation or typing rules. Eventually, properties can be introduced which can be tested. Of course, these can be run.</p>\n<p>The tool is kept as general as possible, so any language can be modelled.</p>\n<h1 id=\"tutorial-developing-a-simple-programming-language\">Tutorial: developing a simple programming language</h1>\n<p>We will develop a programming language which can work with booleans and integers. Apart from doing basic arithmetic, we can also use anonymous functions.</p>\n<p>Example programs are:</p>\n\n<p>The expression <code>(\\x : Int . x + 1)</code> is a <em>lambda expression</em>. This is an anonymous function, taking one argument - named x- of type <code>Int</code>. When applied (e.g. <code>(\\x : Int . x + 1) 41</code>, the expression right of the <code>.</code> is returned, with the variable <code>x</code> substituted by the argument, becoming <code>41 + 1</code>.</p>\n<h2 id=\"setting-up-a-language\">Setting up a language</h2>\n<p>A language is declared inside a <code>.language</code> file <a href=\"#fn2\" class=\"footnoteRef\" id=\"fnref2\"><sup>2</sup></a>. Create <code>STFL.language</code>, and put a title in it:</p>\n\n<p>You can put comments wherever you want after a <code>#</code>, e.g. to give some explanation about the language</p>\n<h2 id=\"declaring-the-syntax\">Declaring the syntax</h2>\n<p>For a full reference on syntax, see the <a href=\"#syntax\">reference manual on syntax</a>.</p>\n<h3 id=\"simple-booleans\">Simple booleans</h3>\n<p>A program is nothing more then a string of a specific form. To describe strings of an arbitrary structure, <em>BNF</em> <a href=\"#fn3\" class=\"footnoteRef\" id=\"fnref3\"><sup>3</sup></a> can be used.</p>\n<p>The syntax of our programming language is defined in the <strong>Syntax</strong>section of <em>STFL.language</em>:</p>\n\n<p>What do we write here? Let's start with declaring the boolean values <code>True</code> and <code>False</code>. We express how these can be parsed by writing <code>bool    ::= &quot;True&quot; | &quot;False&quot;</code>. This tells the tool that a syntactic form named <code>bool</code> exists and it is either <code>True</code> of <code>False</code>. Note the double quotes, these are important to indicate that we want this string literally. The <code>|</code> epxresses that it can choose between those forms.</p>\n<p><em>STFL.language</em> now looks like:</p>\n\n<p>Lets try running this! Create <code>examples.stfl</code>, which contains:</p>\n\n<p>We can parse these by running (in your terminal) <code>./ALGT STFL.language examples.stfl bool -l</code>. The first argument is the language file, the second the examples, the <code>bool</code> tells ALGT what syntactic rule to parse. The <code>-l</code> flag expresses that each line should be treated individually.</p>\n<p>If all went well, you should get the following output:</p>\n\n<p>The most interesting part here is that <code>True</code> has been parsed with <code>bool.0</code>, thus the first choice of the <code>bool</code>-form, while <code>False</code> has been parsed with the second form.</p>\n<h3 id=\"if-statements\">If-statements</h3>\n<p>Now, let's add expressions of the form <code>If True Then False Else True</code>. We define a new syntactic form: <code>expr     ::= &quot;If&quot; bool &quot;Then&quot; bool &quot;Else&quot; bool</code>.<a href=\"#fn4\" class=\"footnoteRef\" id=\"fnref4\"><sup>4</sup></a> This tell <em>ALGT</em> that an expression starts with a literal <code>If</code>, is followed by a <code>bool</code> (so either <code>True</code> or <code>False</code>), is followed by a literal <code>Then</code>, ... The tool uses the double quotes <code>&quot;</code> to distinguish between a literal string and another syntactic form.</p>\n<p><em>STFL.language</em> now looks like:</p>\n\n<p>This captures already some example expressions. Let's add <code>If True Then False Else True</code> to <em>examples.stfl</em>:</p>\n\n<p>Let's run our tool, this time with <code>./ALGT STFL.language examples.stfl</code> <strong>expr</strong> <code>-l</code></p>\n\n<p>Oops! Seems like our parser now always wants to see a <code>If</code> in the beginning, and can't handle <code>True</code> anymore. Perhaps we should tell that a <code>bool</code> is a valid expression to:</p>\n\n<p>Lets see what this gives:</p>\n\n<p>Looks a lot better! The third example shows clearly how the expression falls apart in smaller pieces.</p>\n<p>What with a nested <code>If</code>?</p>\n<p><code>If If True Then False Else True Then True Else False</code> clearly can't be parsed, as the condition should be a <code>bool</code>, according to our current syntax.</p>\n<p>Well, we can just write <code>expr</code> instead of <code>bool</code> in our syntax:</p>\n\n<p>Running this gives</p>\n\n<p>This clearly shows how the parse trees are nested. This can be rendered too:<a href=\"#fn5\" class=\"footnoteRef\" id=\"fnref5\"><sup>5</sup></a></p>\n<div class=\"figure\">\n<img src=\"data:image/png;base64,\" alt=\"ParseTree of a nested condition\" style=\"width:100.0%\" />\n<p class=\"caption\">ParseTree of a nested condition<a href=\"#fn6\" class=\"footnoteRef\" id=\"fnref6\"><sup>6</sup></a></p>\n</div>\n<h3 id=\"adding-numbers-subtyping-and-forbidden-left-recursion\">Adding numbers, subtyping and forbidden left recursion</h3>\n<p>Time to spice things up with numbers. To make things easier, integers are built in as <code>Number</code>. It's good practice to introduce a new syntactic rule for them:</p>\n\n<p>As an <code>int</code> is a valid expression, we add it to the <code>expr</code> form:</p>\n\n<p>Note that every <code>int</code> now also is an <code>expr</code>, just as every <code>bool</code> is an <code>expr</code>. This typing relationship can be visualized with <code>ALGT STFL.language -lsvg Subtyping.svg</code><a href=\"#fn7\" class=\"footnoteRef\" id=\"fnref7\"><sup>7</sup></a> :</p>\n<div class=\"figure\">\n<img src=\"data:image/png;base64,\" alt=\"Subtyping relation of STFL.language\" style=\"width:25.0%\" />\n<p class=\"caption\">Subtyping relation of STFL.language</p>\n</div>\n<p>Now that numbers have been added, let's run this with a number as example:</p>\n\n<p>should give</p>\n\n<p>So far, so good! Time to add addition:</p>\n\n<p>expr &quot;+&quot; expr</p>\n<p>We add some example:</p>\n\n<p>And run it:</p>\n\n<p>Oops! Looks like we did something wrong. What is this left recursion? Whenever the parser wants to parse an expression, it tries every choice from left to right. This means that whenever it tries to parse <code>expr</code>, it should first try to parse <code>expr</code>. That's not really helpfull, so the parser might get in an infinite loop then.</p>\n<p>Not allowing left recursion also means that no loops in the subtypings occur. In other words, the subtyping relationship is a <a href=\"https://en.wikipedia.org/wiki/Lattice_(order)\">lattice</a>.</p>\n<p>The solution to this problem is splitting <code>expr</code> in two parts: a <code>term</code> with simple elements in front, and <code>expr</code> with advanced forms:</p>\n\n<p>Let's retry this:</p>\n\n<p>What went wrong this time? The parser tries choice after choice. When parsing <code>20 + 22</code> against <code>expr ::= term | term &quot;+&quot; term</code>, it'll first try <code>term</code> (and not <code>term &quot;+&quot; term</code>). It succesfully parses <code>20</code> against the lonely <code>term</code>, thus the input string <code>+ 22</code> is left. The parser doesn't know what to do with this leftover part, so we get an error.</p>\n<p>To fix this, we change the order:</p>\n\n<p>When we try again, we get:</p>\n\n<div class=\"figure\">\n<img src=\"data:image/png;base64,\" alt=\"Parsetree of 20+22\" style=\"width:50.0%\" />\n<p class=\"caption\">Parsetree of <code>20+22</code></p>\n</div>\n<div class=\"figure\">\n<img src=\"data:image/png;base64,\" alt=\"Parsetree of 1 + 2 + 3\" style=\"width:50.0%\" />\n<p class=\"caption\">Parsetree of <code>1 + 2 + 3</code></p>\n</div>\n<h3 id=\"lambda-expressions\">Lambda expressions</h3>\n<p>The lambda expression is the last syntactic form we'd like to add. Recall that these look like <code>(\\x : Int . x + 1)</code>.</p>\n<h4 id=\"variables\">Variables</h4>\n<p>The first thing we should deal with, are variables. A builtin is provided for those, namely <code>Identifiers</code>, matching all words starting with a lowercase (matching <code>[a-z][a-zA-Z0-9]*</code>). Let's introduce them in our syntax:</p>\n\n<p>A <code>var</code> is valid in expressions too, e.g. in the expression <code>x + 1</code>, so we want to add it to our <code>term</code>:</p>\n\n<h4 id=\"types\">Types</h4>\n<p>The second ingredient we still need, are types, to annotated the input types. Valid types, for starters, are <code>Bool</code> and <code>Int</code>.</p>\n<p>But what is the type of <code>(\\x : Int . x + 1)</code>? It's something that takes an <code>Int</code> and gives back an <code>Int</code>. We type this as <code>Int -&gt; Int</code>.</p>\n<p>And what is the type of a function, taking another function as an argument? That would be, for example, <code>(Int -&gt; Int) -&gt; Int</code>, meaning we need to add a form with parentheses.</p>\n<p>Recalling the trouble we had with left recursion and ordering, we write <code>type</code> as following:</p>\n\n<p>Some examples of types are:</p>\n<p><img src=\"data:image/png;base64,\" style=\"width:50.0%\" /> <img src=\"data:image/png;base64,\" style=\"width:50.0%\" /></p>\n<p><img src=\"data:image/png;base64,\" style=\"width:50.0%\" /> <img src=\"data:image/png;base64,\" style=\"width:50.0%\" /> <img src=\"data:image/png;base64,\" style=\"width:50.0%\" /></p>\n<h3 id=\"lambda-expressions-1\">Lambda expressions</h3>\n<p>Now we have what we need to define lambda expressions. As they act as a term, we add it there:</p>\n\n<p>Backslash is the escape character, so use two of them to represent a single backslash.</p>\n<p>We can also apply arguments to a lambda expression. We expand <code>expr</code>:</p>\n\n<h3 id=\"what-about-nonsensical-input\">What about nonsensical input?</h3>\n<p>With the current syntax, expresions as <code>If 5 Then True else False</code>, <code>True + 5</code>, <code>True 5</code> or <code>(\\x : Int : x + 1) True</code> can be written. We allow these forms to be parsed, as the next stage of the compiler (the typechecker) will catch these errors. How to construct this, will be explained in <a href=\"#building-a-typechecker\">a following section</a>.</p>\n<h3 id=\"recap\">Recap</h3>\n<p>Our <em>STFL.language</em> contains</p>\n\n<p>Our <em>examples.stfl</em> contains</p>\n\n<p>We run this with</p>\n<ul>\n<li><code>ALGT STFL.language examples.stfl expr -l</code> to show the parsetrees</li>\n<li><code>ALGT STFL.language examples.stfl expr -l --ptsvg SVGnames</code> to render the parsetrees as SVG</li>\n<li><code>ALGT STFL.language --lsvg SVGname.svg</code> to visualize the subtyping relationship.</li>\n</ul>\n<div class=\"figure\">\n<img src=\"data:image/png;base64,\" alt=\"The final subtyping relationship of STFL.language\" style=\"width:100.0%\" />\n<p class=\"caption\">The final subtyping relationship of STFL.language</p>\n</div>\n<h2 id=\"functions\">Functions</h2>\n<p>For a full reference on syntax, see the <a href=\"#functions-1\">reference manual on functions</a>.</p>\n<h3 id=\"domain-and-codomain\">Domain and codomain</h3>\n<p>It'll come in handy later on to be able to calculate the <em>domain</em> and <em>codomain</em> of a function type. The <em>domain</em> of a function is the type it can handle as input. The <em>codomain</em> of a function is the type it gives as output.</p>\n<table>\n<caption>Examples of domain and codomain</caption>\n<thead>\n<tr class=\"header\">\n<th align=\"left\">Function type</th>\n<th align=\"left\">dom</th>\n<th align=\"left\">cod</th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"odd\">\n<td align=\"left\"><code>Int -&gt; Bool</code></td>\n<td align=\"left\"><code>Int</code></td>\n<td align=\"left\"><code>Bool</code></td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>(Int -&gt; Bool)</code></td>\n<td align=\"left\"><code>Int</code></td>\n<td align=\"left\"><code>Bool</code></td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>Int -&gt; Bool -&gt; Bool</code></td>\n<td align=\"left\"><code>Int</code></td>\n<td align=\"left\"><code>Bool -&gt; Bool</code></td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>Int -&gt; (Bool -&gt; Bool)</code></td>\n<td align=\"left\"><code>Int</code></td>\n<td align=\"left\"><code>Bool -&gt; Bool</code></td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>(Int -&gt; Bool) -&gt; Bool</code></td>\n<td align=\"left\"><code>Int -&gt; Bool</code></td>\n<td align=\"left\"><code>Bool -&gt; Bool</code></td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>Int</code></td>\n<td align=\"left\"><em>Undefined</em></td>\n<td align=\"left\"><em>Undefined</em></td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>Bool</code></td>\n<td align=\"left\"><em>Undefined</em></td>\n<td align=\"left\"><em>Undefined</em></td>\n</tr>\n</tbody>\n</table>\n<p>Now, let's define these functions!</p>\n<p></p>\n<h3 id=\"the-function-section\">The function section</h3>\n<p>We add a new header to <em>STFL.language</em>:</p>\n\n<p>In this function section, we can define the function <em>dom</em> in the following way:</p>\n\n<p>So, what is going on here? Let's first take a look to the first line:</p>\n\n<p>The <code>domain</code> is the name of the function. The <code>type -&gt; type</code> indicates what syntactic form is taken as input (a <code>type</code>) before the <code>-&gt;</code> and what is given as output (again a <code>type</code>).</p>\n<div class=\"figure\">\n<img src=\"data:image/png;base64,\" alt=\"Relevant XKCD (by Randall Munroe, #917)\" style=\"width:100.0%\" />\n<p class=\"caption\">Relevant XKCD (by Randall Munroe, #917)</p>\n</div>\n<h3 id=\"pattern-matching\">Pattern matching</h3>\n<p>Let's have look at the body of the function:</p>\n\n<p>What happens if we throw in <code>Int -&gt; Bool</code>? Remember that this is parsed as a tree, with three leafs. Notice that there are three elements in the pattern match to: a variable <code>T1</code>, a literal <code>-&gt;</code> and a variable <code>T2</code>. These leafs are matched respectively:</p>\n<div class=\"figure\">\n<img src=\"data:image/png;base64,\" alt=\"Pattern matching in action\" style=\"width:100.0%\" />\n<p class=\"caption\">Pattern matching in action</p>\n</div>\n<p>The same principle applies with more advanced inputs:</p>\n<div class=\"figure\">\n<img src=\"data:image/png;base64,\" alt=\"Pattern matching in action (more advanced)\" style=\"width:100.0%\" />\n<p class=\"caption\">Pattern matching in action (more advanced)</p>\n</div>\n<p>We thus always bind <code>T1</code> to the part before the top-level <code>-&gt;</code>, in other words: we always bind the input type (or domain type) to <code>T1</code>. As that is exactly what we need, we return it!</p>\n<h3 id=\"missing-cases\">Missing cases</h3>\n<p>This already gives us the most important part. However, what should we do if the first argument type is a function? e.g. <code>(Int -&gt; Bool) -&gt; Bool</code>:</p>\n<div class=\"figure\">\n<img src=\"data:image/png;base64,\" alt=\"Typetree of function argument\" style=\"width:50.0%\" />\n<p class=\"caption\">Typetree of function argument</p>\n</div>\n<p>This will match the pattern <code>T1 &quot;-&gt;&quot; T2</code> as following:</p>\n<div class=\"figure\">\n<img src=\"data:image/png;base64,\" alt=\"Typetree of function argument, matched\" style=\"width:50.0%\" />\n<p class=\"caption\">Typetree of function argument, matched</p>\n</div>\n<p>We see that <code>T1</code> includes the <code>(</code> and <code>)</code>, which we don't want. We simply solve this by adding a extra clause:</p>\n\n<p>We expect that the part <em>before</em> the arrow now is surrounded by parens. Note that we put parens once without double quotes and once with. These parens capture this part of the parsetree and match it against the patterns inside the parens, as visible in the green ellipse:</p>\n<div class=\"figure\">\n<img src=\"data:image/png;base64,\" alt=\"Recursive pattern matching\" style=\"width:50.0%\" />\n<p class=\"caption\">Recursive pattern matching</p>\n</div>\n<h3 id=\"recursion\">Recursion</h3>\n<p>There is a last missing case, namely if the entire type is wrapped in parens.</p>\n<p>We match a type between parens, and then calculate its domain simply by calling the domain function again.</p>\n\n<h3 id=\"clause-determination\">Clause determination</h3>\n<p>As you can see, there are two clauses now. How do we now what clause is executed?</p>\n<p>Simply put, when the function is evaluated, the arguments are pattern matched against the first clause. If this pattern match succeeds, the expression on the right hand side is returned. Do the arguments not match the patterns? Then the next clause is considered.</p>\n<p>In other words, clauses are tried <strong>from top to bottom</strong> and tested. The first clause of which the patterns match, is executed.</p>\n<p>When no clauses match, an error message is given.</p>\n<h3 id=\"executing-functions\">Executing functions</h3>\n<p>Let's put this to a test. We can calculate the domain of our examples.</p>\n<p>Create a file <code>typeExamples.stfl</code>, with contents</p>\n\n<p>Run this with <code>ALGT STFL.language typeExamples.stfl type -l -f domain</code>:</p>\n\n<p>What does this output tell?</p>\n<p>For starters, we get a warning that we forgot two cases, namely <code>Bool</code> and <code>Int</code>. For some functions this is a problem, but domain is not defined for those values.</p>\n<p>Then, we see an overview for each function what result it gives (or an error message if the pattern matches failed).</p>\n<p>If you want more information about the behaviour of a function, specify <code>--ia</code> or <code>--ifa FUNCTION-TO-ANALYZE</code> to get a clause-per-clause overview:</p>\n\n<h3 id=\"codomain\">Codomain</h3>\n<p><code>codomain</code> can be implemented totally analogously:</p>\n\n<h2 id=\"relations-and-rules\">Relations and Rules</h2>\n<h2 id=\"building-smallstep\">Building smallstep</h2>\n<h2 id=\"building-bigstep\">Building bigstep</h2>\n<h2 id=\"building-a-typechecker\">Building a typechecker</h2>\n<h2 id=\"properties\">Properties</h2>\n<h2 id=\"recap-used-command-line-arguments\">Recap: used command line arguments</h2>\n<h1 id=\"reference-manual\">Reference manual</h1>\n<h2 id=\"general\">General</h2>\n<p>A language is defined in a <code>.language</code>-file. It starts (optionally) with a title:</p>\n\n<p>Comments start with a <code>#</code> and can appear quasi everywhere.</p>\n\n<p>Syntax, functions, relations, ... are all defined in their own sections:</p>\n\n<p>A section header starts with an upper case, is underlined with <code>=</code> and followed by a blank line.</p>\n<h2 id=\"syntax\">Syntax</h2>\n<p>All syntax is defined in the <code>Syntax</code> section. It consists out of <code>BNF</code>-rules, of the form</p>\n\n<p>Choices might be written on multiple lines, as long as at least one tab precedes them:</p>\n\n<h3 id=\"literals\">Literals</h3>\n<p>A string that should be matched exactly, is enclosed in <code>&quot;</code> (double quotes). Some characters can be escaped with a backslash, namely:</p>\n<table>\n<caption>Escape sequences</caption>\n<thead>\n<tr class=\"header\">\n<th align=\"left\">Sequence</th>\n<th align=\"left\">Result</th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"odd\">\n<td align=\"left\"><code>\\n</code></td>\n<td align=\"left\">newline</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>\\t</code></td>\n<td align=\"left\">tab</td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>\\&quot;</code></td>\n<td align=\"left\">double quote</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>\\\\</code></td>\n<td align=\"left\">backslash</td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"parsing-order\">Parsing order</h3>\n<p>Rules are parsed <strong>left to right</strong>, in other words, choices are tried in order. No backtracking happens when a choice is made; the parser is a <em>recursive descent parser</em>. This has two drawbacks: left recursion results in an infinite loop and the ordering of choices does matter.</p>\n\n<h3 id=\"builtin-syntactic-forms\">Builtin syntactic forms</h3>\n<p>Some syntactic forms are already provided for your convenience, namely:</p>\n<table>\n<caption>Builtin syntax</caption>\n<colgroup>\n<col width=\"22%\"></col>\n<col width=\"55%\"></col>\n<col width=\"22%\"></col>\n</colgroup>\n<thead>\n<tr class=\"header\">\n<th align=\"left\">Builtin</th>\n<th align=\"left\">Meaning</th>\n<th align=\"left\">Regex</th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"odd\">\n<td align=\"left\"><code>Identifier</code></td>\n<td align=\"left\">Matches an identifier</td>\n<td align=\"left\"><code>[a-z][a-zA-Z0-9]*</code></td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>Number</code></td>\n<td align=\"left\">Matches an (negative) integer. Integers parsed by this might be passed into the builtin arithmetic functions.</td>\n<td align=\"left\"><code>-?[0-9]*</code></td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>Any</code></td>\n<td align=\"left\">Matches a single character, whatever it is, including newline characters</td>\n<td align=\"left\"><code>.</code></td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>Lower</code></td>\n<td align=\"left\">Matches a lowercase letter</td>\n<td align=\"left\"><code>[a-z]</code></td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>LineChar</code></td>\n<td align=\"left\">Matches a single character that is not a newline</td>\n<td align=\"left\"><code>[^\\n]</code></td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>Upper</code></td>\n<td align=\"left\">Matches an uppercase letter</td>\n<td align=\"left\"><code>[A-Z]</code></td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>Digit</code></td>\n<td align=\"left\">Matches an digit</td>\n<td align=\"left\"><code>[0-9]</code></td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>String</code></td>\n<td align=\"left\">Matches a double quote delimted string</td>\n<td align=\"left\"><code>&quot;([^&quot;\\]|\\&quot;|\\\\)*&quot;</code></td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"subtyping-relationship\">Subtyping relationship</h3>\n<p>A syntactic form equals a (possibly infinite) set of strings. By using a syntactic form <code>a</code> as choice in other syntactic form <code>b</code>, <code>a</code> will be a subset of be, giving the natural result that <code>a</code> is a subtype of <code>b</code>.</p>\n<p>In the following examle, <code>bool</code> and <code>int</code> are both subsets of <code>expr</code>. This can be visualised with the <code>--lsvg Output.svg</code>-flag.</p>\n<pre><code>bool    ::= &quot;True&quot; | &quot;False&quot;\nint     ::= Number\nexpr    ::= ... | bool | int</code></pre>\n<h3 id=\"whitespace-in-sequences\">Whitespace in sequences</h3>\n<p>Whitespace (the characters <code>&quot; &quot;</code>,<code>&quot;\\t&quot;</code>), is parsed by default (and ignored completely). If you want to parse a whitespace sensitive language, use other symbols to declare the rule:</p>\n<table>\n<caption>Whitespace modes</caption>\n<thead>\n<tr class=\"header\">\n<th align=\"left\">Operator</th>\n<th align=\"left\">Meaning</th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"odd\">\n<td align=\"left\"><code>::=</code></td>\n<td align=\"left\">Totally ignore whitespace</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>~~=</code></td>\n<td align=\"left\">Parse whitespace for this rule only</td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>//=</code></td>\n<td align=\"left\">Parse whitespace for this rule and all recursively called rules</td>\n</tr>\n</tbody>\n</table>\n<p>This gives rise to the following behaviour:</p>\n<table style=\"width:78%;\">\n<caption>Whitespace mode examples</caption>\n<colgroup>\n<col width=\"33%\"></col>\n<col width=\"44%\"></col>\n</colgroup>\n<thead>\n<tr class=\"header\">\n<th align=\"left\">Syntax</th>\n<th align=\"left\">Matching String</th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"odd\">\n<td align=\"left\"><p><code>a ::= &quot;b&quot; &quot;c&quot; x</code></p></td>\n<td align=\"left\"><p><code>b c x y</code></p></td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><p><code>x ::= &quot;x&quot; &quot;y&quot;</code></p></td>\n<td align=\"left\"><p><code>bcxy</code></p></td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"></td>\n<td align=\"left\"><code>b\\tc\\tx\\ty</code></td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"></td>\n<td align=\"left\"><code>b c\\txy</code></td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"></td>\n<td align=\"left\">...</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"></td>\n<td align=\"left\"></td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><p><code>a ~~= &quot;b&quot; &quot;c&quot; x</code></p></td>\n<td align=\"left\"><p><code>bcx y</code></p></td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><p><code>x ::= &quot;x&quot; &quot;y&quot;</code></p></td>\n<td align=\"left\"><p><code>bcxy</code></p></td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"></td>\n<td align=\"left\"><code>bcx\\ty</code></td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"></td>\n<td align=\"left\"></td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><p><code>a //= &quot;b&quot; &quot;c&quot; x</code></p></td>\n<td align=\"left\"><p><code>bcxy</code></p></td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><p><code>x ::= &quot;x&quot; &quot;y&quot;</code></p></td>\n<td align=\"left\"></td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"grouping-sequences\">Grouping sequences</h3>\n<p>Sometimes, you'll want to group an entire rule as a token (e.g. comments, an identifier, ...)</p>\n<p>Add a <code>$</code> after the assignment to group it.</p>\n<pre><code>text                    ::= LineChar line | LineChar\ncommentLine             ::= $ &quot;#&quot; text &quot;\\n&quot;\n\ncustomIdentifier        ::= $ Upper Number</code></pre>\n<p>When such a token is used in a pattern or expression, the contents of this token are parsed against this rule:</p>\n<pre><code>f               : customIdentifier -&gt; statement\nf(&quot;X10&quot;)        = &quot;X9&quot; &quot;# Some comment&quot;</code></pre>\n<h2 id=\"functions-1\">Functions</h2>\n<h3 id=\"patterns-and-expressions\">Patterns and expressions</h3>\n<p>Functions transform their input. A function is declared by first giving its type, followed by one or more clauses:</p>\n<pre><code>f               : a -&gt; b\nf(a, &quot;b&quot;)       = &quot;c&quot;\nf(a, b)         = &quot;d&quot;</code></pre>\n<p>When an input is given, arguments are pattern matched against the patterns on between parentheses. If the match succeeds, the expression on the right is given. If not, the next clause is given.</p>\n<p>Note that using the same variable multiple times is allowed, this will only work if these arguments are the same:</p>\n<pre><code>f(a, a)         = ...</code></pre>\n<p>Recursion can be used just as well:</p>\n<pre><code>f(&quot;a&quot; a)        = f(a)</code></pre>\n<p>This is purely functional, heavily inspired on Haskell.</p>\n<h4 id=\"possible-expressions\">Possible expressions</h4>\n<table style=\"width:100%;\">\n<colgroup>\n<col width=\"30%\"></col>\n<col width=\"20%\"></col>\n<col width=\"49%\"></col>\n</colgroup>\n<thead>\n<tr class=\"header\">\n<th align=\"left\">Expr</th>\n<th align=\"left\">Name</th>\n<th align=\"left\">As expression</th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"odd\">\n<td align=\"left\"><code>x</code></td>\n<td align=\"left\">Variable</td>\n<td align=\"left\">Recalls the parsetree associated with this variable</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>_</code></td>\n<td align=\"left\">Wildcard</td>\n<td align=\"left\"><em>Not defined</em></td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>42</code></td>\n<td align=\"left\">Number</td>\n<td align=\"left\">This number</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>&quot;Token&quot;</code></td>\n<td align=\"left\">Literal</td>\n<td align=\"left\">This string</td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>func(arg0, arg1, ...)</code></td>\n<td align=\"left\">Function call</td>\n<td align=\"left\">Evaluate this function</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>!func:type(arg0, ...)</code></td>\n<td align=\"left\">Builtin function call</td>\n<td align=\"left\">Evaluate this builtin function, let it return a <code>type</code></td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>(expr or pattern:type)</code></td>\n<td align=\"left\">Ascription</td>\n<td align=\"left\">Checks that an expression is of a type. Bit useless</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>e[expr or pattern]</code></td>\n<td align=\"left\">Evaluation context</td>\n<td align=\"left\">Replugs <code>expr</code> at the same place in <code>e</code>. Only works if <code>e</code> was created with an evaluation context</td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>a &quot;b&quot; (nested)</code></td>\n<td align=\"left\">Sequence</td>\n<td align=\"left\">Builds the parse tree</td>\n</tr>\n</tbody>\n</table>\n<h4 id=\"possible-patterns\">Possible patterns</h4>\n<table style=\"width:100%;\">\n<colgroup>\n<col width=\"40%\"></col>\n<col width=\"59%\"></col>\n</colgroup>\n<thead>\n<tr class=\"header\">\n<th align=\"left\">Expr</th>\n<th align=\"left\">As pattern</th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"odd\">\n<td align=\"left\"><code>x</code></td>\n<td align=\"left\">Captures the argument as the name. If multiple are used in the same pattern, the captured arguments should be the same or the match fails.</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>_</code></td>\n<td align=\"left\">Captures the argument and ignores it</td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>42</code></td>\n<td align=\"left\">Argument should be exactly this number</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>&quot;Token&quot;</code></td>\n<td align=\"left\">Argument should be exactly this string</td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>func(arg0, arg1, ...)</code></td>\n<td align=\"left\">Evaluates the function, matches if the argument equals the result. Can only use variables which are declared left of this pattern</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>!func:type(arg0, ...)</code></td>\n<td align=\"left\">Evaluates the builtin function, matches if the argument equals the result. Can only use variables which are declared left of this pattern</td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>(expr or pattern:type)</code></td>\n<td align=\"left\">Check that the argument is an element of <code>type</code></td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>e[expr or pattern]</code></td>\n<td align=\"left\">Matches the parsetree with <code>e</code>, searches a subpart in it matching <code>pattern</code></td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>a &quot;b&quot; (nested)</code></td>\n<td align=\"left\">Splits the parse tree in the appropriate parts, pattern matches the subparts</td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"typechecking\">Typechecking</h3>\n<h4 id=\"equality\">Equality</h4>\n\n<p>When equality checks are used in the pattern matching, the variable will be typed as the smallest common supertype of both types. If such a supertype does not exist, an error message is given.</p>\n<p>Note that using a supertype might be a little <em>too</em> loose, but won't normally happen in real-world examples.</p>\n<p>In the given example, <code>x</code> will be typed as <code>c</code>, the common super type. In this example, <code>x</code> might also be a <code>d</code>, while this is not possible for the input. This can be solved by splitting of <code>a | b</code> as a new rule.</p>\n<h3 id=\"totality--and-liveabilitychecks\">Totality- and liveabilitychecks</h3>\n<p>Can be disabled with <code>--no-check</code>, when they take to long.</p>\n<h3 id=\"higher-order-functions-and-currying\">Higher order functions and currying?</h3>\n<p>Are not possible for now (v 0.1.18.1). Perhaps in a future version or when someone really needs it and begs for it.</p>\n<h3 id=\"builtin-functions\">Builtin functions</h3>\n<table style=\"width:99%;\">\n<colgroup>\n<col width=\"12%\"></col>\n<col width=\"66%\"></col>\n<col width=\"19%\"></col>\n</colgroup>\n<thead>\n<tr class=\"header\">\n<th align=\"left\">name</th>\n<th align=\"left\">Descr</th>\n<th align=\"left\">Arguments</th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"odd\">\n<td align=\"left\"><code>plus</code></td>\n<td align=\"left\">Gives a sum of all arguments (0 if none given)</td>\n<td align=\"left\">Ints only</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>min</code></td>\n<td align=\"left\">Gives the first argument, minus all the other arguments</td>\n<td align=\"left\">At least 1, Ints only</td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>mul</code></td>\n<td align=\"left\">Multiplies all the arguments. (1 if none given)</td>\n<td align=\"left\">Ints only</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>div</code></td>\n<td align=\"left\">Gives the first argument, divided by the product of the other arguments. (Integer division, rounded down))</td>\n<td align=\"left\">At least 1, Ints only</td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>mod</code></td>\n<td align=\"left\">Gives the first argument, module the product of the other arguments.</td>\n<td align=\"left\">At least 1, Ints only</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>neg</code></td>\n<td align=\"left\">Gives the negation of the argument</td>\n<td align=\"left\">Exactly 1, Ints only</td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>equal</code></td>\n<td align=\"left\">Checks that all the arguments are equal. Gives 1 if so, 0 if not.</td>\n<td align=\"left\">At least 2</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>error</code></td>\n<td align=\"left\">Stops the function, gives a stack trace. When used in a rule, this won't match a predicate</td>\n</tr>\n<tr class=\"odd\">\n<td align=\"left\"><code>freshvar</code></td>\n<td align=\"left\">Generates an identifier not present in the arguments. If the first argument is an identifier, identifiers are based on that form.</td>\n</tr>\n<tr class=\"even\">\n<td align=\"left\"><code>subs</code></td>\n<td align=\"left\">(expression to replace, to replace with, in this expression) Replaces each occurence of the first expression by the second, in the third argument</td>\n<td align=\"left\">Exactly 3</td>\n</tr>\n</tbody>\n</table>\n<h2 id=\"relations-and-rules-1\">Relations and Rules</h2>\n<h2 id=\"properties-1\">Properties</h2>\n<h2 id=\"command-line-flags\">Command line flags</h2>\n<h1 id=\"used-concepts-and-algorithms\">Used concepts and algorithms</h1>\n<h1 id=\"dynamization-and-gradualization\">Dynamization and gradualization</h1>\n<h1 id=\"thankword\">Thankword</h1>\n<p>Thanks to</p>\n<ul>\n<li>Christophe Scholliers</li>\n<li>Ilion Beyst, for always being up to date, giving ideas, spotting bugs at first sight, implementing <code>Nederlands</code> and his enthousiasm in general</li>\n<li>Isaura Claeys, for proofreading and finding a lot of typos</li>\n</ul>\n<div class=\"footnotes\">\n<hr />\n<ol>\n<li id=\"fn1\"><p>Note the similarity of <em>ALGT</em> and <em>AGT</em> . The tool started its life as <em>AGT</em>, based on the paper <a href=\"https://pleiad.cl/papers/2016/garciaAl-popl2016.pdf\"><em>Abstracting Gradual Typing</em></a>. When it became more general, another name and acronym was chosen.<a href=\"#fnref1\">\8617</a></p></li>\n<li id=\"fn2\"><p>Actually, the extension doesn't matter at all.<a href=\"#fnref2\">\8617</a></p></li>\n<li id=\"fn3\"><p>Backus-Naur-form, as introduced by John Backus in the <a href=\"http://www.softwarepreservation.org/projects/ALGOL/report/Algol60_report_CACM_1960_June.pdf\">ALGOL60-report</a>.<a href=\"#fnref3\">\8617</a></p></li>\n<li id=\"fn4\"><p>Don't worry about spaces and tabs, we deal with them. If you want need to parse stuff like &quot;duizendeneen&quot; or whitespace sensitive languages, please refer to the <a href=\"#syntax\">reference manual</a><a href=\"#fnref4\">\8617</a></p></li>\n<li id=\"fn5\"><p>These images can be created with <code>ALGT STLF.language examples.stfl -l --ptsvg Outputname</code><a href=\"#fnref5\">\8617</a></p></li>\n<li id=\"fn6\"><p>These images can be created with <code>ALGT STLF.language examples.stfl -l --ptsvg Outputname</code><a href=\"#fnref6\">\8617</a></p></li>\n<li id=\"fn7\"><p>Creating this svg might take a long time for complicated syntaxes, as ALGT calculates the ordering of labels resulting in the least intersecting lines.<a href=\"#fnref7\">\8617</a></p></li>\n</ol>\n</div>\n</body>\n</html>\n"
