_Test_CommonSubset_language
	 = "\n Test\n******\n\n Syntax\n========\n\na\t::= c | \"a\"\nb\t::= c | \"b\"\nc\t::= \"X\"\nd\t::= a | b\ne\t::= a | b | y\n\ny\t::= \"Y\"\n\n# Functions\n#===========\n\n\n#f\t: a -> b -> y\n#f(x, x)\t= \"Y\"\n"
_Test_examples_stfl
	 = "True\nFalse\nIf True Then False Else True\nIf (If True Then False Else True) Then False Else True\n42\n1 + 2\n(\\f : Int -> Int . f 5) (\\i : Int . i + 1)\n(True)\nFalse :: Bool\n( True )\n(If True Then True Else True) :: Bool\nTrue\n(False)\nTrue :: Bool\nIf True Then 42 Else 43\nIf False Then 23 Else 44\n5 + 6\n5 + 6 + 7\n(\\x : Int . x + 1) 5\nIf (If True Then False Else True) Then 123456 Else 42\n5 + (6 + 7)\n(5 + 6) + (7 + 8)\n5 + (6 + (7 + 8))\n(\\x : Int . x + 1) True\n"
