_Test_LiveCheck_language
	 = " \n STFL \n******\n\n# A Simply Typed Function Language\n\n Syntax\n========\n\nbool\t::= \"True\" | \"False\"\n\n\n# Types\ntypeL\t::= \"Int\" | \"Bool\" | \"(\" type \")\"\ntype\t::= typeL \"->\" type | typeL\n\n\n\nvar\t::= Identifier\nnumber\t::= Number\nvalue\t::= bool | number\n\ne\t::= eL \"+\" e \n\t| eL \"::\" type \n\t| eL e\n\t| eL\n\neL\t::= value \n\t| var \n\t| \"(\" \"\\\\\" var \":\" type \".\" e \")\" \n\t| \"If\" e \"Then\" e \"Else\" e | \"(\" e \")\"\n\n\n Functions\n===========\n\n\n\nsubs\t\t\t\t\t\t: var -> e -> e -> e\nsubs(x, y, x)\t\t\t\t\t= y\nsubs(x, y, \"(\" \"\\\\\" z \":\" t \".\" rest \")\" )\t= \"(\" \"\\\\\" z \":\" t \".\" subs(x,y,rest) \")\"\nsubs(x, y, \"If\" cond \"Then\" e1 \"Else\" e2)\t= \"If\" subs(x, y, cond) \"Then\" subs(x, y, e1) \"Else\" subs(x, y, e2)\nsubs(x, y, e1 \"+\" e2)\t\t\t\t= subs(x, y, e1) \"+\" subs(x, y, e2)\nsubs(x, y, e \"::\" type)\t\t\t\t= subs(x, y, e) \"::\" type\nsubs(x, y, f arg)\t\t\t\t= subs(x, y, f) subs(x, y, arg) \nsubs(x, y, \"(\" e \")\")\t\t\t\t= \"(\" subs(x, y, e) \")\"\nsubs(x, y, z) \t\t\t\t\t= z\n"
_Test_DynamizeSTFL_language_changes
	 = " \n Dynamized\n***********\n\n# Turns the runtime of STFL into a dynamic runtime, so that 'faulty' programs evaluate to \"TYPE ERROR\" instead of not compiling into a proof tree \n\n Syntax Changes\n================\n\n\neL \t::= ... | \"TYPE ERROR\"\n\n\n\n New Rules\n===========\n\n\n e : number\n-------------------------\t[EvalCastBoolErr]\n e \"::\" \"Bool\" \8594 \"TYPE ERROR\"\n\n e : bool\n-------------------------\t[EvalCastIntErr]\n e \"::\" \"Int\" \8594 \"TYPE ERROR\"\n\n \n--------------------------------------  \t[EvalIfErr]\n \"If\" (cond:number) \"Then\" e1 \"Else\" e2 \8594 \"TYPE ERROR\"\n\n\n-----------------------------------  \t[EvalPlusErrL]\n (n1:bool) \"+\" n2 \8594 \"TYPE ERROR\"\n\n\n----------------------------------\t[EvalPlusErrR]\n n1 \"+\" (n2:bool) \8594 \"TYPE ERROR\"\n\n\n-------------------\t[CanonError]\n (\10003) \"TYPE ERROR\"\n\n\n\n\n\n Rule Changes\n==============\n\n# We 'check' input typing by ascribing.\n# The (\10003) arg is important to force an ordering on the evaluation, otherwise multiple orders are possible\n\n (\10003) arg\t(arg \"::\" type) \8594 arg'\n------------------------------------------------------------\t[EvalLamApp]\n (\"(\" \"\\\\\" var \":\" type \".\" e \")\") arg \8594 !subs:e(var, arg', e)\n\n"
_Test_GradualizeSTFL_language_changes
	 = "\n Gradualized\n************* \n\n\n Syntax Changes\n================\n\n\nRename type to gtype\nRename typeL to gtypeL\n\ngtypeL \t::= ... | \"?\"\n\n\n\n Function Changes\n==================\n\ndom\t\t: gtype -> gtype\n...\ndom(\"?\")\t= \"?\"\n\ncod\t\t: gtype -> gtype\n...\ncod(\"?\")\t= \"?\"\n\n\nequate\t\t: gtype -> gtype -> gtype\n...\nequate(\"?\", t)\t= t\nequate(t, \"?\")\t= t\nequate(t11 \"->\" t12, t21 \"->\" t22)\n\t\t= equate(t11, t21) \"->\" equate(t12, t22)\n\n\n Relation Changes\n==================\n\nRename (==) to (~), pronounced as \"is consistent\"\n\n\n New Rules\n===========\n\n --------- [ConsLeft]\n  \"?\" ~ T\n\n\n --------- [ConsRight]\n  T ~ \"?\"\n\n\n\n\n------------------  \t[EvalCastUnkown]\n e \"::\" \"?\" \8594 e\n\n \n\n (\10003) arg\t(arg \"::\" gtype) \8594 arg'\n------------------------------------------------------------\t[EvalLamApp']\n (\"(\" \"\\\\\" var \":\" gtype \".\" e \")\") arg \8594 !subs:e(var, arg', e)\n\n\n\n\n Rule Changes\n==============\n\nDelete [EvalLamApp]\n\n\n"
_Test_STFL_language
	 = " \n STFL \n******\n\n# A Simply Typed Function Language\n\n Syntax\n========\n\nbool\t::= \"True\" | \"False\"\n\n\n\n# Types\ntypeL\t::= \"Int\" | \"Bool\" | \"(\" type \")\"\ntype\t::= typeL \"->\" type | typeL\n\n\n\nvar\t::= Identifier\nnumber\t::= Number\nvalue\t::= bool | number\n\ne\t::= eL \"+\" e \n\t| eL \"::\" type \n\t| eL e\n\t| eL\n\neL\t::= value \n\t| var \n\t| \"(\" \"\\\\\" var \":\" type \".\" e \")\" \n\t| \"If\" e \"Then\" e \"Else\" e \n\t| \"(\" e \")\"\n\n\ntyping\t\t\t::= var \":\" type\ntypingEnvironment\t::= typing \",\" typingEnvironment | \"{}\"\n\ntypeSet\t\t\t::= type typeSet | \"$\"\n\n\n\n Syntax Style\n==============\n\ntype\t-> \"type\"\ntypeL\t-> \"type\"\n\nvar\t-> \"identifier\"\nnumber\t-> \"constant\"\nbool\t-> \"constant\"\ne\t-> \"statement\"\neL\t-> \"statement\"\neL.4\t-> \"noise\"\neL.2\t-> \"noise\"\n\n\"constant\" -> \"keyword\"\n\n\n Functions\n===========\n\n\n# deduces a new name for the variable in an lambda abstraction\nrename\t\t: var -> var -> type -> e -> eL\nrename(x, newVar, type, body)\n\t\t= \"(\" \"\\\\\" newVar \":\" type \".\" !subs:e(x, newVar, body ) \")\"\n\n\neval\t\t\t: e -> value\neval( (v : value) )\t= v\neval((\"(\" \"\\\\\" x \":\" t \".\" e \")\") arg)\n\t\t\t= eval(!subs:e(x, arg, e))\neval(f a)\t\t= eval(eval(f) a)\neval(\"If\" \"True\" \"Then\" e1 \"Else\" e2)\n\t\t\t= eval(e1)\neval(\"If\" \"False\" \"Then\" e1 \"Else\" e2)\n\t\t\t= eval(e2)\neval(\"If\" c \"Then\" e1 \"Else\" e2)\n\t\t\t= eval(\"If\" eval(c) \"Then\" e1 \"Else\" e2)\neval(\"(\" e \")\")\t\t= eval(e)\neval(e1 \"+\" e2)\t\t= !plus:number(eval(e1), eval(e2))\neval(e \"::\" t)\t\t= eval(e)\neval( (v:var) )\t\t= !error:value(\"Unknown variable\", v)\neval(\"(\" \"\\\\\" v \":\" t \".\" e \")\")\n\t\t\t= !error:value(\"Lone lambda expression left\")\n\n\ndefaultValue\t\t: type -> eL\ndefaultValue(\"Bool\")\t= \"True\"\ndefaultValue(\"Int\")\t= 1\ndefaultValue(ta \"->\" tr)\n\t\t\t= \"(\" \"\\\\\" \"x\" \":\" ta \".\" defaultValue(tr) \")\"\ndefaultValue(\"(\" t \")\")\t= defaultValue(t)\n\ndom \t\t: type -> type\ndom(\"(\" T \")\")\t= dom(T)\ndom(T1 \"->\" T2) = T1\ndom(\"Bool\")\t= !error:type(\"Not defined for Bool\")\ndom(\"Int\")\t= !error:type(\"Not defined for Int\")\n\n\n\ncod \t\t: type -> type\ncod(\"(\" T \")\")\t= cod(T)\ncod(T1 \"->\" T2) = T2\ncod(\"Bool\")\t= !error:type(\"Not defined for Bool\")\ncod(\"Int\")\t= !error:type(\"Not defined for Int\")\n\n# wrappers for builtin functions, as we can't type within a builtin\nplus\t\t: number -> e -> number\nplus(e1, e2)\t= !plus:number(e1, e2)\n\n\nequate\t\t: type -> type -> type\nequate(T, T)\t= T\nequate(T1, T2)\t= !error:type(\"Not the same type\")\n\n\nconcr\t\t: type -> typeSet\nconcr(\"Int\")\t= \"Int\" \"$\"\nconcr(\"Bool\")\t= \"Bool\" \"$\"\nconcr(\"(\" T \")\")\n\t\t= concr(T)\nconcr(T1 \"->\" T2)\n\t\t= arrow(concr(T1), concr(T2))\n\n\n\nabstract\t\t: typeSet -> type\nabstract(\"$\")\t\t= !error:type(\"Undefined\")\nabstract(\"Int\" \"$\")\t= \"Int\"\nabstract(\"Bool\" \"$\")\t= \"Bool\"\nabstract((\"(\" T \")\") ts)\n\t\t\t= abstract(T ts)\nabstract((T1 \"->\" T2) ts)\n\t\t\t= abstract(domains( (T1 \"->\" T2) ts)) \"->\" abstract(codomains( (T1 \"->\" T2) ts))\n\n\ndomains\t\t: typeSet -> typeSet\ndomains((T1 \"->\" _) ts)\n\t\t= T1 domains(ts)\ndomains(\"$\")\t= \"$\"\ndomains(_)\t= !error:typeSet(\"Not defined, as this is not a proper list of functions\")\n\n\ncodomains\t\t: typeSet -> typeSet\ncodomains((_ \"->\" T2) ts)\n\t\t= T2 codomains(ts)\ncodomains(\"$\")\t= \"$\"\ncodomains(_)\t= !error:typeSet(\"Not defined, as this is not a proper list of functions\")\n\n\n\narrow\t\t: typeSet -> typeSet -> typeSet\narrow(\"$\", _)\t= \"$\"\narrow(_, \"$\")\t= \"$\"\narrow(t0 ts0, t1 ts1)\n\t\t= (t0 \"->\" t1) concatTypeSet(arrow(ts0, t1 ts1), arrow(ts0, ts1))\n\n\n\nconcatTypeSet\t: typeSet -> typeSet -> typeSet\nconcatTypeSet(\"$\", ts)\n\t\t= ts\nconcatTypeSet(t ts, ts0)\n\t\t= t concatTypeSet(ts, ts0)\n\n\n\n Relations\n===========\n\n# (:) is reserved, as predicate that a term is of a production rule\n# one can refer to rewrite rules/functions earlier on\n\n(\8594)\t: e (in), e (out)\tPronounced as \"evaluation\"\n(\8594*)\t: e (in), value (out)\tPronounced as \"big step\"\n(\10003)\t: e (in)\t\tPronounced as \"is canonical\"\n\n(\8866)\t: typingEnvironment (in), e (in), type (out)\tPronounced as \"context entails typing\"\n\n(::)\t: e (in), type (out)\tPronounced as \"type in empty context\"\n\n(==)\t: type (in), type (in)\tPronounced as \"equals\"\n\n\n Rules\n=======\n\n\n\n\n e0 \8594 e1\n-----------------\t\t\t[EvalCtx]\n e[e0] \8594 e[e1]\n\n\n\n n1:number\tn2:number\n------------------------------------\t[EvalPlus]\n (n1:number) \"+\" n2 \8594 plus(n1, n2)\n\n\n\n b:bool\n--------------------\t\t\t[EvalAscrBool]\n b \"::\" \"Bool\" \8594 b\n\n i:number\n-------------------\t\t\t[EvalAscrInt]\n i \"::\" \"Int\" \8594 i\n\n\n e \"::\" t \8594 e\n------------------------ [EvalAscrPar]\n e \"::\" (\"(\" t \")\") \8594 e\n\n\n----------------\t\t\t[EvalParens]\n \"(\" e \")\" \8594 e\n\n\n---------------------------------------\t\t[EvalIfTrue]\n \"If\" \"True\" \"Then\" e1 \"Else\" e2 \8594 e1\n\n\n----------------------------------------\t[EvalIfFalse]\n \"If\" \"False\" \"Then\" e1 \"Else\" e2 \8594 e2\n\n\n------------------------------------------------------------\t[EvalLamApp]\n (\"(\" \"\\\\\" var \":\" type \".\" e \")\") arg \8594 !subs:e(var, arg, e)\n\n\n\n\n\n b:bool\n-------\t\t\t[CanonBool]\n (\10003) b\n\n n:number\n---------\t\t[CanonNumber]\n (\10003) n\n\n\n\n (\10003) e\n--------\t\t\t[BigStepCanon]\n e \8594* e\n\n e0 \8594 e1\te1 \8594* e2\n-------------------------\t[BigStepRec]\n e0 \8594* e2\n\n e0 \8594 e1\t(\10003) e1\n------------------------\t[BigStepBase]\n e0 \8594* e1\n\n\n\n\n\n \"{}\" \8866 e, T  \n-----------\t[TEmptyCtx]\n e :: T\n\n\n\n\n n:number\n---------------\t\t[Tnumber] \n \915 \8866 n, \"Int\"\n\n\n b:bool\n----------------\t[Tbool]\n \915 \8866 b, \"Bool\"\n\n\n\n \915 \8866 e, T\n-------------------\t[TParens]\n \915 \8866 \"(\" e \")\", T\n\n\n \915 \8866 e, T'\tT' == T\n----------------------- [TAscr]\n \915 \8866 e \"::\" T, T'\n\n\n\n--------------------\t[Tx]\n \915[ x \":\" T ] \8866 x, T\n\n\n \915 \8866 n1, \"Int\"\t\915 \8866 n2, \"Int\"\n------------------------------\t\t\t\t[TPlus]\n \915 \8866 n1 \"+\" n2, \"Int\"\n\n\n \915 \8866 c, \"Bool\"\t\915 \8866 e1, Tl\t\915 \8866 e2, Tr\tTl == Tr\n--------------------------------------------------------\t[TIf]\n \915 \8866 \"If\" c \"Then\" e1 \"Else\" e2, Tl\n\n\n\n ((x \":\" T1) \",\" \915) \8866 e, T2\n-------------------------------------------------------\t[TLambda]\n \915 \8866 \"(\" \"\\\\\" x \":\" T1 \".\" e \")\", ( \"(\" T1 \")\") \"->\" T2\n\n\n\n \915 \8866 e1, Tfunc\t\915 \8866 e2, Targ\tTarg == dom(Tfunc)\n---------------------------------------------------\t[Tapp]\n \915 \8866 e1 e2, cod(Tfunc)\n\n\n\n\n\n\n T1 = T2 : type\n--------------- [EqBase]\n T1 == T2\n\n\n T1 == T2\n----------------- [EqParL]\n \"(\" T1 \")\" == T2\n\n T1 == T2\n----------------- [EqParR]\n T1 == \"(\" T2 \")\"\n\n\n Ta1 == Ta2\tTb1 == Tb2\n---------------------------------- [EqArrow]\n Ta1 \"->\" Tb1   ==   Ta2 \"->\" Tb2\n\n\n Properties\n============\n\n e0 :: T\t e0 \8594 e1\n-------------------------- [Preservation]\n         e1 :: T\n\n\n         e0 :: T\n-------------------------- [Progress]\n (\10003) e0    |     e0 \8594 e1 \n\n\n\n# STFL can't contain loops (or recursion), so will always terminate\n\n \n e :: T\n-------- [Termination]\n e \8594* v \n\n"
